import './App.css';


class App extends React.Component {
  state = {
    valueStatus: "",
    valuePassword: "",
    valueEmail: ""
  }
  render() {
    return (
      <div className="wrapper">
        <div className="header">Заголовок</div>
        <div>Статус</div>
        <div>Город</div>
        <div>Пароль</div>
        <div>Логин</div>
        <div>Чекбокс</div>
        <div>Кнопка</div>
      </div>
    )
  }
}

export default App
